import{_ as e,o as r,c as t,O as a}from"./chunks/framework.9482e208.js";const f=JSON.parse('{"title":"§ 24.2-417 Persons to be registered.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/24.2-417.md","filePath":"vacode/24.2-417.md"}'),i={name:"vacode/24.2-417.md"},o=a('<h1 id="§-24-2-417-persons-to-be-registered" tabindex="-1">§ 24.2-417 Persons to be registered. <a class="header-anchor" href="#§-24-2-417-persons-to-be-registered" aria-label="Permalink to &quot;§ 24.2-417 Persons to be registered.&quot;">​</a></h1><p>Each registrar shall register every resident of his county or city who has the qualifications required by the Constitution of Virginia and this title and who applies for registration or transfer of his registration from another county or city in the Commonwealth at the time and in the manner required by law.</p><p>Any person, once properly registered, shall remain registered unless his registration is cancelled pursuant to Article 5 (§ <a href="http://law.lis.virginia.gov/vacode/24.2-427/" target="_blank" rel="noreferrer">24.2-427</a> et seq.) of this chapter.</p><p>Code 1950, §§ 24-67, 24-68; 1952, c. 341; 1958, c. 576; 1960, c. 288; 1962, c. 536; 1963, Ex. Sess., c. 2; 1970, c. 462, §§ 24.1-47, 24.1-48; 1971, Ex. Sess., cc. 119, 205; 1972, c. 620; 1974, c. 428; 1977, c. 490; 1980, c. 639; 1989, c. 138; 1992, c. 433; 1993, c. 641; 1996, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?961+ful+CHAP0072" target="_blank" rel="noreferrer">72</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?961+ful+CHAP0073" target="_blank" rel="noreferrer">73</a>; 2000, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?001+ful+CHAP0857" target="_blank" rel="noreferrer">857</a>.</p>',4),s=[o];function n(c,l,h,d,p,_){return r(),t("div",null,s)}const u=e(i,[["render",n]]);export{f as __pageData,u as default};
